const KANSEI_IMAGE_DATA = 'data:image/jpeg;base64,';

function applyKanseiImages() {
  document.querySelectorAll('[data-kansei-img]').forEach((img) => {
    img.src = KANSEI_IMAGE_DATA;
  });
}

if (typeof window !== 'undefined') {
  if (document.readyState === 'complete' || document.readyState === 'interactive') {
    applyKanseiImages();
  } else {
    document.addEventListener('DOMContentLoaded', applyKanseiImages);
  }
}
